import React, { useState } from 'react'
import Movie from '../shared-components/movie'

const PopularMovies = () => {
    const [movies, setMovies] = useState(null)

    const getPopularMovies = () => {
        fetch('/api')
            .then((res) => res.json())
            .then((data) => setMovies(data.message))
            .console.log(movies)
    }

    return (
        <>
        <button onClick={getPopularMovies}>CLICK me!</button>
        <div>{!movies ? 'Loading' : 
            movies.map(({title}, index) => 
                <Movie title={title} />
            )} 
        </div>
        </>

    )
}

export default PopularMovies;
